import React, { Component, useState } from 'react'



export default class User extends Component {

  state = {
    categorys: [
      { id: 1, catogryNames: "dodo" },
      { id: 2, catogryNames: "melo" }
    ]

    
  };



  render() {

    return (
      <div className="user-list"> 
      <h3>{this.props.info.title}</h3>
        <div className="catogry">
         
          { this.state.categorys.map(cato => (
              <div onClick={() => this.props.change(cato)} key={cato.id}>
                {cato.catogryNames}
                </div>
            )) }
        </div>
        <h2>{this.props.state.conTextt}</h2>
      </div>
    )
  }
}
